import React from 'react';
import './componente.css';

function Componente2(reyes) {
    document.getElementById('caja').style.backgroundColor = reyes.color_style
  return (
    <div id='caja'>
        <h2>{reyes.nombre}</h2>
        <img src={reyes.img_rey}></img>
        <div>{reyes.precio}</div>
    </div>
  )
}

export default Componente2
